from cuckoo_filter import CuckooFilter

#blocks = ['', '', '']

def check_cuckoo(blocks,token):
    # Create a filter with a capacity of 100000 items
    cf = CuckooFilter(table_size=100000)

    for i in blocks:
        try:
            cf.insert(i)
        except:
            pass
            #print(i)
    
    return cf.__contains__(str(token))

